#define SDRAM_BASE            0xC0000000
#define FPGA_ONCHIP_BASE      0xC8000000
#define FPGA_CHAR_BASE        0xC9000000

/* Cyclone V FPGA devices */
#define LEDR_BASE             0xFF200000
#define HEX3_HEX0_BASE        0xFF200020
#define HEX5_HEX4_BASE        0xFF200030
#define SW_BASE               0xFF200040
#define KEY_BASE              0xFF200050
#define TIMER_BASE            0xFF202000
#define PIXEL_BUF_CTRL_BASE   0xFF203020
#define CHAR_BUF_CTRL_BASE    0xFF203030
#define PS2_BASE			  0xFF200100
	

/* VGA colors */
#define WHITE 0xFFFF
#define YELLOW 0xFFE0
#define RED 0xF800
#define GREEN 0x07E0
#define BLUE 0x001F
#define CYAN 0x07FF
#define MAGENTA 0xF81F
#define GREY 0xC618
#define PINK 0xFC18
#define ORANGE 0xFC00
#define BLACK 0x0000

/* Screen size. */
#define RESOLUTION_X 320
#define RESOLUTION_Y 240

#define FALSE 0
#define TRUE 1

#include <stdlib.h>
#include <stdio.h>
#include <stdbool.h>


volatile int pixel_buffer_start; 
void swap(int* a, int* b);
int abs(int a);
void clear_screen();
void wait_for_vsync();

void draw_pixel(int x, int y, short int line_color);
void draw_box(int x, int y, short int line_color);
void draw_mainscreen();


int main(void) {
	volatile int* pixel_ctrl_ptr = (int*)PIXEL_BUF_CTRL_BASE;
	*(pixel_ctrl_ptr + 1) = 0xC8000000; 
	wait_for_vsync();
	pixel_buffer_start = *pixel_ctrl_ptr; 

	clear_screen(); 

	*(pixel_ctrl_ptr + 1) = 0xC0000000;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); 

	//PS/2 keyboard setup
	volatile int* PS2_ptr = (int*)PS2_BASE; 
	int PS2_data, RVALID; 
	char byte1 = 0, byte2 = 0, key_pressed; 
	bool IS_KEY_PRESSED = FALSE; 
	
	//clear the field (reset) 
	*(PS2_ptr) = 0xFF; 

	clear_screen();


	//continue until enter or I is pressed to continue with the same 
	while(!IS_KEY_PRESSED) {
		draw_mainscreen();
		wait_for_vsync(); 
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); 

		//check what key was pressed on the keyboard 
		PS2_data = *(PS2_ptr);
		RVALID = PS2_data & 0x8000; 
		if (RVALID) {
			//shift the next data byte into the display 
			key_pressed = PS2_data; 
			byte1 = byte2; 
			byte2 = PS2_data & 0xFF; 

			//check if the key pressed is enter or I for Instructions 
			if (key_pressed == 0x43) {
				printf("Instructions\n "); 
				IS_KEY_PRESSED = TRUE; 
			}

			if (key_pressed == 0x5A ) {
				printf("Play the game\n"); 
				IS_KEY_PRESSED = TRUE; 

			}
		}
		


	}
}
	
	
void draw_mainscreen() {
	for (int x = 0; x < 320; x++) {
		for (int y = 0; y < 240; y++) {
			draw_pixel(x, y, game_title[y][x]);
		}
	}
}

void draw_pixel(int x, int y, short int line_color)
{
	*(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}


void wait_for_vsync() {
	volatile int* pixel_ctrl_ptr = (int*)0xFF203020;
	register int status;

	*pixel_ctrl_ptr = 1;

	status = *(pixel_ctrl_ptr + 3); 

	while ((status & 0x01) != 0) {
		status = *(pixel_ctrl_ptr + 3); 
	}
}



void clear_screen() {
	for (int x = 0; x < RESOLUTION_X; x++) {
		for (int y = 0; y < RESOLUTION_Y; y++) {
			draw_pixel(x, y, 0);
		}
	}
} 


void swap(int* a, int* b) {
	int temp;
	temp = *a;
	*a = *b;
	*b = temp;
}

int abs(int a) {
	if (a < 0) {
		return -a;
	}
	return a;
}













